import Recat from "react";


function youtuber(){
    var youtuber = "Coding Stuffs";
    return youtuber
}

function favgame(){
    var game = "PUBG";
    return game
}

function project(){
    let project = ["blogs","Artificial intelligence", "Book store", "Hotel"]
    return project[1]
}

export default youtuber;
export {favgame,project};
